import React from 'react';
import { Menu, Icon, Input } from 'antd';

const { Search } = Input;

const AppTopbar = () => {
    return(
        <div>
          <Menu mode="horizontal">
            <Menu.Item key="mail">
                <Icon type="home" />
            </Menu.Item>
            <Menu.Item key="search">
                <Search
                    placeholder="input search text"
                    enterButton="Search"
                    size="large"
                    onSearch={value => console.log(value)}
                /> 
            </Menu.Item>
            <Menu.Item key="bell">
                <Icon type="bell" />
            </Menu.Item>
          </Menu>  
        </div>
    );
};

export default AppTopbar;
